import react from 'react';
import Carousel from 'nuka-carousel';

import img1 from './story3.jpg/1000x400/ffffff/c0392b';
import img2 from './story4.jpg/1000x400/ffffff/c0392b';

const Slide = () => {
  return (
    <Carousel>
      <img src='story3.jpg/1000x400/ffffff/c0392b' />
      <img src='story4.jpg/1000x400/ffffff/c0392b' />
    </Carousel>
  );
};

export default Slide;
